import React from 'react';
import Tweet from "./tweet";

function App () {
  return (
    <div className="app">
    <Tweet name="Ula"/>
    <Tweet name="Mateusz"/>
    <Tweet name="Jan"/>
    <Tweet name="Maja"/>
    </div>
  );
}

export default App;
